- Invent_Order_Control: It indicates whether this item is auto-approval or semi-approval. Its applied only on allocation items. (If an item is Year Round - in other words store replenishment item- regardless of this value it will be auto-approval) Its a binary flag. It can be either 0 or 1. We also allow NULL values. Its default value is zero. Therefore if its NULL, it will be treated as zero. [Value = 0 means semi-approval] [Value = 1 means auto-approval]
- Force_YR_Repl: It indicates whether this item is forced to be in YR replenishment regardless of the season information. Default value is zero.[Value = 0 means it will respect season information] [Value = 1 means the item is forced to be in YR replenishment]
